import React ,{Component} from 'react';

class ImageCaraousel extends Component
{
   
    render()
    {
        let i=0;
        return (
            <div className="carousel">
                <table>
                    <tbody>
                        <tr>
                            <td>
                            <button onClick={()=>{this.props.onPrevious((i<=0)?i=2:--i)}} className="carousel-previous-btn"> P </button>

                            </td>
                            <td>
                            <img src="https://i1.sndcdn.com/artworks-000482183808-s7h0nx-t500x500.jpg" alt="carousel-art" id="carouselItem"/>

                            </td>
                            <td>
                            <button onClick={()=>{this.props.onNext((i>=2)?i=0:++i)}}  className="carousel-next-btn"> N</button>
                            </td>
                        </tr>
                    </tbody>
                </table>

            </div>
    
                );
    }
   
}

export default ImageCaraousel;
